import React from 'react';

class CustomFooter extends React.Component {
  render() {
    return (
      <div className="content-column">
        Contact Me
        <div style={{ display: 'inline'}}>
          <Icon type="mail" />
          nina.manalo19@gmail.com
        </div>
      </div>
    )
  }
}

export default CustomFooter;
